import styles from '../styles/Header.module.css';

const Header = () => {
  return (

      <div className={styles.header}>
        <div className={styles.logo}></div>
        <p className={styles.myPage}>My Page</p>
        <button>
          <i class="fa-solid fa-magnifying-glass"></i>
        </button>
      </div>

  );
};

export default Header;
